//// SPDX-License-Identifier: MIT
pragma solidity >=0.5.0 <0.7.0;

contract Main {
    string  public name = "BT Token";
    string  public symbol = "BT";
    string  public standard = "BT Token v1.0";
    uint256 public totalSupply = 1000000000000000000000000; //1 million tokens
    uint8   public decimals = 18;
    uint public rate = 100;

    event Transfer(
        address indexed _from,
        address indexed _to,
        uint256 _value
    );

    event Approval(
        address indexed _owner,
        address indexed _spender,
        uint256 _value
    );

    event TokensPurchased(
        address account,
        uint amount,
        uint rate
    );


    event TokensSold(
        address account,
        uint amount,
        uint rate
    );


    event Transfer30(
        address from,
        uint amount
    );

    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    struct pendings{
        uint amount;
        address sender;
        address reciever;
    }

    mapping(string => pendings) amountPending; 
    mapping(address => uint) public amountBlocked;


    constructor() public {
        balanceOf[address(this)] = totalSupply;
    }



    //Function to transfer the BT-tokens from the msg.sender to _to 
    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value, "Not enough balance");
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    //Function to approve using of wallet
    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    //Function to transfer BT_Tokens from one address to another
    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= balanceOf[_from], "Not enough balance");
        //require(_value <= allowance[_from][msg.sender], "Not enough allowance");
        //require(_value <= (balanceOf[_from]-amountBlocked[_from]), "Amount has been blocked");
        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;
        allowance[_from][msg.sender] -= _value;
        emit Transfer(_from, _to, _value);
        return true;
    }


    //Function to buy tokens from contract and in change of ether
    function buyTokens() public payable {

        uint tokenAmount = msg.value * rate;
        require(balanceOf[address(this)] >= tokenAmount, "Insufficient balance");
        //transfer(msg.sender, tokenAmount);
        transferFrom(address(this), msg.sender, tokenAmount);

        // Emit an event
        emit TokensPurchased(msg.sender, tokenAmount, rate);
    }


    //Function to sell tokens to contract and get ether back
    function sellToken(uint _amount) public {

        require(balanceOf[msg.sender] >= _amount, "Insufficient balance");

        uint etherAmount = _amount / rate;

        require(address(this).balance >= etherAmount,"Not enough ether");

        transferFrom(msg.sender, address(this), _amount);

        msg.sender.transfer(etherAmount);

        //Event
        emit TokensSold(msg.sender, _amount, rate);

    }


    function transfer30(uint _amount, string memory _tId, address _reciever) public {

        require(balanceOf[msg.sender] >= _amount, "Insufficient user balance");

        uint transferAmount = (_amount * 30 ) / 100;

        amountBlocked[msg.sender] = (_amount * 70 ) / 100;

        amountPending[_tId] = pendings({
            amount: _amount,
            sender: msg.sender,
            reciever: _reciever
        });

        transferFrom(msg.sender, address(this), transferAmount);

        //Emit an event
        emit Transfer30(msg.sender, transferAmount);
    }


    function transfer70(string memory _tradeId) public {
        require(balanceOf[msg.sender] >= amountPending[_tradeId].amount, "Insufficient balance");

        //transferring 70% from sender to reciever
        transferFrom(amountPending[_tradeId].sender, amountPending[_tradeId].reciever, ((amountPending[_tradeId].amount * 70) / 100));

        //Transfer 30% from admin wallet
        transferFrom(address(this), amountPending[_tradeId].reciever, ((amountPending[_tradeId].amount * 30) / 100));
    }


}
